import React from 'react';
import brazilStates from '../states'

class PersonalData extends React.Component {
  render() {
    return (
      <fieldset>
        <label>
          <input type="text" name="nome" maxLength="40" required />
        </label>

        <label>
          <input type="email" name="email" maxLength="50" required />
        </label>

        <label>
          <input type="text" name="cpf" maxLength="11" required />
        </label>

        <label>
          <input type="text" name="adress" maxLength="200" required />
        </label>

        <label>
          <input type="text" name="city" maxLength="28" required />
        </label>

        <label>
          <select>
            {brazilStates.forEach(element => {
              <option> {element} </option>
            })};
          </select>
        </label>

      </fieldset>
    )
  }
}

export default PersonalData;
